using System;
using Sigesp.Domain.Models;
using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;
using Sigesp.Domain.Enums;

namespace Sigesp.Infra.Data.Mappings
{
    public class ContaUsuarioMap : IEntityTypeConfiguration<ContaUsuario>
    {
        public void Configure(EntityTypeBuilder<ContaUsuario> builder)
        {
            builder.ToTable("ContaUsuarios");

            builder.HasKey(c => c.Id);

            builder.Property(c => c.Id)
                .HasColumnName("Id");

            builder.Property(c => c.Nome)
                .HasColumnName("Nome")
                .HasColumnType("varchar(100)");

            builder.Property(c => c.Setor)
                .HasColumnName("Setor")
                .HasColumnType("varchar(100)");

            builder.Property(c => c.Funcao)
                .HasColumnName("Funcao")
                .HasColumnType("varchar(100)");
            
            // builder.HasQueryFilter(m => EF.Property<bool>(m, "IsDeleted") == false);
            builder.HasQueryFilter(p => !p.IsDeleted);

